var minOperations = function(nums1, nums2) {
    let operations = 0;
    let maxNums1 = Math.max(...nums1);
    let maxNums2 = Math.max(...nums2);

    if (nums1[nums1.length - 1] === maxNums1 && nums2[nums2.length - 1] === maxNums2) {
        return 0; // Already in desired state
    }

    // Swapping to make nums1[n-1] = max(nums1) and nums2[n-1] = max(nums2)
    if (nums1[nums1.length - 1] !== maxNums1) {
        let indexMaxNums2 = nums2.indexOf(maxNums2);
        if (indexMaxNums2 !== -1 && nums1[indexMaxNums2] < maxNums2) {
            [nums1[indexMaxNums2], nums2[indexMaxNums2]] = [nums2[indexMaxNums2], nums1[indexMaxNums2]];
            operations++;
        }
    }

    if (nums2[nums2.length - 1] !== maxNums2) {
        let indexMaxNums1 = nums1.indexOf(maxNums1);
        if (indexMaxNums1 !== -1 && nums2[indexMaxNums1] < maxNums1) {
            [nums1[indexMaxNums1], nums2[indexMaxNums1]] = [nums2[indexMaxNums1], nums1[indexMaxNums1]];
            operations++;
        }
    }

    // Check if conditions are met after operations
    if (nums1[nums1.length - 1] !== Math.max(...nums1) || nums2[nums2.length - 1] !== Math.max(...nums2)) {
        return -1; // Impossible to satisfy conditions
    }

    return operations;
};
